from geopy.geocoders import Nominatim
geolocator = Nominatim(user_agent="Mozilla/5.0")
def addrToGPS(addrstr):
	try:
		location = geolocator.geocode(addrstr)
		print(addrstr, (location.latitude, location.longitude))
		return (location.latitude, location.longitude)
	except:
		print(addrstr, 'Error')
		return ('err', 'err')


